import React,{useContext} from 'react';
import {Button,Image} from 'react-bootstrap';
//Styles
import Styles from './Switch.module.css';
//hook-Logic
import useSwitch from './useSwitch';
import ProfilePicture from '../Card/Image/usuario.svg'

const Switch = ()=>{
    const [ActiveButton,ButtonRef] = useSwitch();
    let current;
    if (ActiveButton.search){
        current = 'search';
    }else{
        current = 'profile';
    }
    return (
    <div className = {Styles.container}>
        {ActiveButton.search && 
            <div ref = {ButtonRef} className = {Styles.ImageContainer}>
                <a href = '#'>
                    <Image src ={ProfilePicture}></Image>
                </a>    
            </div>
        }       
    </div>  
        
    )
}
export default Switch;
